import React from "react";
import './Intro.css';

export default function Intro(){
    return(
        <>
        <div className="intro" id="intro">
            <div className="left">
                <h3>Hii, There I'm </h3>
                <h1>Kaif Siddique</h1>
                <h2>Web Developer <span>  FrontEnd</span></h2>
            </div>
            <div className="right"></div>
        </div>
        </>
    );
}
